import { Container, Grid, Card, CardContent, CardMedia, Typography, Box, Chip, IconButton } from '@mui/material';
import { motion } from 'framer-motion';
import GitHubIcon from '@mui/icons-material/GitHub';
import LaunchIcon from '@mui/icons-material/Launch';

const projects = [
  {
    id: 1,
    title: '포트폴리오 웹사이트',
    description: 'React와 TypeScript를 사용한 반응형 포트폴리오 웹사이트입니다. Material-UI와 Framer Motion을 활용하여 모던한 디자인과 부드러운 애니메이션을 구현했습니다.',
    image: '/images/portfolio.jpg',
    technologies: ['React', 'TypeScript', 'Material-UI', 'Framer Motion'],
    github: 'https://github.com/yourusername/portfolio',
    demo: 'https://your-portfolio.com',
  },
  {
    id: 2,
    title: '쇼핑몰 프로젝트',
    description: '전자상거래 플랫폼으로, 사용자 인증, 상품 검색, 장바구니, 결제 기능을 구현했습니다. Redux를 사용한 상태 관리와 MongoDB를 활용한 데이터베이스 구축을 담당했습니다.',
    image: '/images/shopping.jpg',
    technologies: ['React', 'Redux', 'Node.js', 'MongoDB'],
    github: 'https://github.com/yourusername/shopping-mall',
    demo: 'https://your-shopping-mall.com',
  },
  {
    id: 3,
    title: '소셜 미디어 앱',
    description: '실시간 채팅과 게시물 공유 기능이 있는 소셜 미디어 애플리케이션입니다. WebSocket을 활용한 실시간 통신과 Firebase를 이용한 인증 시스템을 구현했습니다.',
    image: '/images/social.jpg',
    technologies: ['React', 'Firebase', 'Tailwind CSS', 'WebSocket'],
    github: 'https://github.com/yourusername/social-app',
    demo: 'https://your-social-app.com',
  },
];

const Projects = () => {
  return (
    <Container maxWidth="lg">
      <motion.div
        initial={{ opacity: 0, y: 20 }}
        animate={{ opacity: 1, y: 0 }}
        transition={{ duration: 0.8 }}
      >
        <Typography
          variant="h2"
          component="h1"
          gutterBottom
          align="center"
          sx={{
            mb: 6,
            background: 'linear-gradient(45deg, #6366f1 30%, #ec4899 90%)',
            backgroundClip: 'text',
            textFillColor: 'transparent',
            WebkitBackgroundClip: 'text',
            WebkitTextFillColor: 'transparent',
          }}
        >
          프로젝트
        </Typography>
      </motion.div>

      <Grid container spacing={4}>
        {projects.map((project, index) => (
          <Grid item xs={12} md={6} key={project.id}>
            <motion.div
              initial={{ opacity: 0, y: 20 }}
              animate={{ opacity: 1, y: 0 }}
              transition={{ duration: 0.5, delay: index * 0.2 }}
            >
              <Card
                sx={{
                  height: '100%',
                  display: 'flex',
                  flexDirection: 'column',
                  borderRadius: '16px',
                  overflow: 'hidden',
                  bgcolor: 'background.paper',
                  border: '1px solid rgba(255, 255, 255, 0.1)',
                  transition: 'transform 0.3s ease-in-out',
                  '&:hover': {
                    transform: 'translateY(-8px)',
                  },
                }}
              >
                <CardMedia
                  component="img"
                  height="240"
                  image={project.image}
                  alt={project.title}
                  sx={{
                    objectFit: 'cover',
                  }}
                />
                <CardContent sx={{ flexGrow: 1, p: 3 }}>
                  <Typography
                    gutterBottom
                    variant="h5"
                    component="h2"
                    sx={{ fontWeight: 600, mb: 2 }}
                  >
                    {project.title}
                  </Typography>
                  <Typography
                    paragraph
                    color="text.secondary"
                    sx={{ mb: 3, lineHeight: 1.7 }}
                  >
                    {project.description}
                  </Typography>
                  <Box sx={{ mb: 3 }}>
                    {project.technologies.map((tech) => (
                      <Chip
                        key={tech}
                        label={tech}
                        sx={{
                          mr: 1,
                          mb: 1,
                          bgcolor: 'rgba(99, 102, 241, 0.1)',
                          color: 'primary.main',
                          '&:hover': {
                            bgcolor: 'rgba(99, 102, 241, 0.2)',
                          },
                        }}
                      />
                    ))}
                  </Box>
                  <Box sx={{ display: 'flex', gap: 1 }}>
                    <IconButton
                      href={project.github}
                      target="_blank"
                      sx={{
                        color: 'text.secondary',
                        '&:hover': {
                          color: 'primary.main',
                        },
                      }}
                    >
                      <GitHubIcon />
                    </IconButton>
                    <IconButton
                      href={project.demo}
                      target="_blank"
                      sx={{
                        color: 'text.secondary',
                        '&:hover': {
                          color: 'primary.main',
                        },
                      }}
                    >
                      <LaunchIcon />
                    </IconButton>
                  </Box>
                </CardContent>
              </Card>
            </motion.div>
          </Grid>
        ))}
      </Grid>
    </Container>
  );
};

export default Projects;
